import React from 'react';
import './App.css';
import nav from './components/navBar/navbar.js';
import {Route,Switch} from 'react-router-dom'

function app() {

    return (
      <div>
        <Switch>
          <Route path='/' exact component={nav}/>
          </Switch>


      </div>
    );
}


export default app;
